import React from "react";
import {NavLink} from "react-router-dom";


const Menu = () => {
    return (
        <>
        <div className="MenuBox">

        <NavLink to="./Home" activeClassName="Menu_part" >Home</NavLink>
        <NavLink to="./Contact" activeClassName="Menu_part" >About</NavLink>
        <NavLink to="./Service" activeClassName="Menu_part" >Service</NavLink> 
        <NavLink to="./User" activeClassName="Menu_part" >User</NavLink>
        
        </div>
        </>
    )
}

export default Menu;
